import React from "react";

function Navbar() {
  return (
    <nav className="bg-green-700 text-white p-4 fixed w-full z-50 shadow-lg">
      <div className="flex justify-between items-center max-w-6xl mx-auto">
        <h1 className="font-bold text-2xl">üêæ Bela's Paw's</h1>
        <div className="space-x-6 hidden md:flex">
          <a href="#home" className="hover:text-yellow-300 transition">Home</a>
          <a href="#about" className="hover:text-yellow-300 transition">About</a>
          <a href="#services" className="hover:text-yellow-300 transition">Services</a>
          <a href="#gallery" className="hover:text-yellow-300 transition">Gallery</a>
          <a href="#reviews" className="hover:text-yellow-300 transition">Reviews</a>
          <a href="#contact" className="hover:text-yellow-300 transition">Contact</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
